import React from 'react';
const Modal = ({active, setActive}) => {
    return (
        <div className={active ? 'modal active' : 'modal'}  onClick={() => setActive(false)}>
            <div className="container">
                <div className={active ? 'modal__content system' : 'modal__content'} onClick={event => event.stopPropagation()}>
                    <video autoPlay="" loop="" controls="" width="640" height="480">
                        <source type="video/mp4"
                                src="https://endtest-videos.s3-us-west-2.amazonaws.com/documentation/endtest_data_driven_testing_csv.mp4"/>
                    </video>
                </div>
            </div>
        </div>
    );
};

export default Modal;
